import Link from "next/link";

const Index = () => (
  <div className="container">
    <div className="row">
      <div className="col-6">
        <img src="/ahunter_rounded.png" alt="Alvison Hunter Arnuero" />
      </div>
    </div>
    <div className="row">
      <h1 className="text-muted">
        Welcome to Mister Excel Tutorials site!
        Please{" "}
        <Link href="/contact">
          <a>contact me</a>
        </Link>{" "}
        to get more information.
      </h1>
    </div>
  </div>
);

export default Index;
